import styled from "styled-components";

const Container = styled.div``;
interface CategoryItemProps {
  item: {
    id: number;
    img: string;
    title: string;
  };
}
const CategoryItem = ({ item }: CategoryItemProps) => {
  return <Container>CategoryItem</Container>;
};

export default CategoryItem;
